  input: TEXT,F3XA,,"ASDC-Dollars for Democrats.....Although there are $19,079.50
    in receipts listed from individuals to the Dollars for Democrats joint fundraising
    activity, the Nebraska Democratic State Central Committee did not take any distributions
    in the current reporting period.                             Two H4 expenditures
    are split between federal and non-federal funds in a split other than the ballot
    composition ratio of  25%75%.  These expenditures are for the postage and printing
    of slate cards sent prior to the primary election.  The slate cards listed numerous
    candidates. therefore the expense was split based on a Time or Space basis.  There
    was only one federal candidate on the slate card, the remainder were non-federal.  A
    portion of the card was generic and was split on the regular ballot composition
    ratio.                                           The Nebraska Democratic Party
    requests all required information on each contribution in excess of $250.   When
    it is noted that not all information is available, a telephone call is made to
    the contributor to get the information.  If the contributor is not reached, a
    message is left on the answer machine requesting that the State Party be called
    with the information.  They are informed that this information is required to
    complete reporting to the Federal Election Commission.  Another telephone call
    is made prior to the filing of the report to get this information.  If unsuccessful
    with this try, the Employer/Occupation is noted with Information Requested.  Prior
    to the filing of this amendment, another attempt was made.  "
